@Override
public boolean seekExact(BytesRef text) {
  termUpto = binarySearch(text, br, 0, info.terms.size()-1, info.terms, info.sortedTerms, BytesRef.getUTF8SortedAsUnicodeComparator());
  return termUpto >= 0;
}

